import React from 'react';
import { YOUTUBEURL,PLAYLISTSITEMS, apiKey } from './apis';
import { playlists } from './Playlist';

const playlistItems = async () => {
    const json = await (
        await fetch(
            `${YOUTUBEURL}${PLAYLISTSITEMS}?key=${apiKey}&playlistId=${playlists().items[0]}&part=id,snippet`
        )
    ).json();
    return json;
};

export {playlistItems};
